[CmdletBinding()]
	Param (
		[Parameter(ValueFromRemainingArguments=$true)]
		[String[]]$Arguments
	)
$foundMain = $false
$data = "qQ" + ""
try {
	$data = [Convert]::FromBase64String("TV" + $data)
	$assembly = [Reflection.Assembly]::Load($data)
}
catch {
	Write-Output "Error: Could not load assembly data!"
	throw
}

foreach($type in $assembly.GetExportedTypes()) {
	foreach($method in $type.GetMethods()) {
		if($method.Name -eq "Main") {
			$foundMain = $true
			if(-not $Arguments) {
				Write-Output "Attempting to run assembly with no arguments"
				$Arguments = @()
			}
			else {
				Write-Output "Attempting to load assembly with arguments: $arguments"
			}
			$a = (,[String[]]@($Arguments))
			
			$prevConOut = [Console]::Out
			$sw = [IO.StringWriter]::New()
			[Console]::SetOut($sw)
			
			try {
				$method.Invoke($null, $a)
			}
			catch {
				Write-Output "Error: Could not invoke assembly or program crashed during execution!"
				throw
			}
			
			[Console]::SetOut($PrevConOut)
			$output = $sw.ToString()
			$output
		}
	}
}
if(!$foundMain) {
	Write-Output "Error: Could not find public Main function!"
	throw
}